import React from 'react';
import tools from '../components/Tools';
import { IonPage, IonContent, IonLabel } from '@ionic/react';
import Wedgits from '../components/Widgets';

const Payment: React.FC = () =>{
    return(
        <IonPage>
            <Wedgits.routes/>
            <Wedgits.Header name="Payment"/>
            <Menu/>
            <IonContent>
                <IonLabel>this is a test</IonLabel>
            </IonContent>
        </IonPage>
    )
}

export default Payment;
